import {useSate} from 'react'
const Tasks = () => {
    const [tasks,setTasks]=useSate(
        [
            {
                id:1,
                text:'Doctors',
                day:'Feb',
                reminder:true,
            },
            {
                id:2,
                text:'Meeting',
                day:'Feb',
                reminder:true,
            },
            {
                id:3,
                text:'Food',
                day:'Feb',
                reminder:false,
            },

        ]
    )
  return (
    <>
        {tasks.map((task)=>
            (<h3 key={task.id}>{task.text}</h3>))}
    </>
  )
}

export default Tasks
